<?phpnamespace App\Models;use Illuminate\Database\Eloquent\Model;class CommissionHistory extends Model {    protected $table = 'commission_histories';    protected $primaryKey = 'id';    protected $fillable = [        'order_id',        'order_detail_id',        'seller_id',        'admin_commission',        'seller_earning',        're_seller_earning',        'itbis'    ];    protected $attributes = [        'itbis' => 0.00,        're_seller_earning' => 0.00,        'seller_earning' => 0.00,        'admin_commission' => 0.00    ];    public function order() {        return $this->hasOne(Order::class, 'id', 'order_id');    }}